            <path d='m1 8h11.667' stroke='#D1D1D3' strokeLinecap='round' strokeLinejoin='round' strokeWidth='1.5' />
            <path d='m6.833 2.1667 5.8333 5.8333-5.8333 5.8334' stroke='#D1D1D3' strokeLinecap='round' strokeLinejoin='round' strokeWidth='1.5' />
        </svg>
    );
}

export default SlimArrowIcon;
